
var audio1 = document.createElement('audio');
var celebrate_mp3 = 'data:audio/mpeg;base64,';
var celebrate_ogg = 'data:audio/ogg;base64,';
var celebrate_wav = 'data:audio/wav;base64,';	
	
$(document).ready(function(){

	
	if (audio1.canPlayType('audio/mpeg')) {
		audio1.type = 'audio/mpeg';
		audio1.src = celebrate_mp3;
	}else if (audio1.canPlayType('audio/ogg')) {
		audio1.type = 'audio/ogg';
		audio1.src = celebrate_ogg;
	} else if(audio1.canPlayType('audio/wav')) {
		audio1.type = 'audio/wav';
		audio1.src = celebrate_wav;
	}


});

function play_sound_celebrate(){
/*
	sound_celebrate.pause();
	sound_celebrate.volume = 1;
*/

		audio1.play();	
}